import * as React from "react";
import Link from 'next/link';
import {Bar, Logo} from './styles';
import { AccountIcon, ShopIcon, DeliveryIcon } from '@component/icons/index';
// LogoIcon from '../../asset/icon/logo.png';

interface Props {
	logo: string;
	locations: [];
}

function Sidebar ({logo, locations}:Props) {
	return (
		<Bar>
			<Link href="/">
				<Logo src="/icon/logo.png" />
			</Link>
			<ul>
				<li>
					<Link href="/">
						<AccountIcon />
					</Link>
				</li>
				<li>
					<Link href="/">
						<ShopIcon />
					</Link>
				</li>
				<li>
					<Link href="/">
						<DeliveryIcon />
					</Link>
				</li>
				<li>
					<Link href="account">
						<AccountIcon />
					</Link>
				</li>
			</ul>
		</Bar>
	);
};

export default Sidebar;
